import React from 'react'
import styled from 'styled-components'
import Logo from '../../images/logo.png'

const NavbarDiv = styled.div`
    position: absolute;
    top: 0;
    width: 100%;
    height: 100px;
    display: flex;
    justify-content: space-around;
`

export default function Navbar(){
    return(
        <NavbarDiv></NavbarDiv>
    )
}
